(18, 'AUDITION AND RECRUITMENT', 'REG_16806933489671', '<p>A-Z EXPERTS presents Audition and Recruitment for Event Hostesses/ ushers.</p>', NULL, NULL, 'uploads/16806959785392506A_Z.jpeg', '1678957818_6800457', '11:15:48', '2023-04-05', 'uploads/16806959785392506A_Z.jpeg', 0, NULL, NULL, 'A-Z EXPERTS', '<p>A-Z EXPERTS is a professional event management company based in Ado Ekiti, Nigeria. With a solid commitment to delivering exceptional event planning and management services, A-Z EXPERTS offers top-notch training on event management and caters to all event needs.</p><p>&nbsp;</p><p>As an industry leader, A-Z EXPERTS has a team of highly skilled and experienced event planners who possess the expertise needed to plan and execute successful events of all types and sizes. From weddings and corporate events to parties and social gatherings, the company manages events from start to finish.</p><p>&nbsp;</p><p>In addition to event planning and management, A-Z EXPERTS provides training services on event management. The company\'s training program equips individuals and organizations with the knowledge and skills they need to plan and execute successful events. With a focus on practical training, participants are equipped with hands-on experience and industry-specific insights.</p><p>&nbsp;</p><p>Overall, A-Z EXPERTS is committed to delivering exceptional event management services while equipping individuals and organizations with the necessary skills to plan and manage successful events.</p>', NULL, NULL, 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-05-17', NULL, 493, NULL, '1', 'A-Z_Experts', NULL, NULL, 78, '', 'paid', 'single', '2500', NULL, NULL, 'a:2:{s:104:\"IERvIHlvdSBoYXZlIHByZXZpb3VzIGV4cGVyaWVuY2UgaW4gdGhlIGFyZWFzIG9mIHVzaGVyaW5nIGFuZCBldmVudCBob3N0ZXNzPw==\";a:5:{s:2:\"id\";s:104:\"IERvIHlvdSBoYXZlIHByZXZpb3VzIGV4cGVyaWVuY2UgaW4gdGhlIGFyZWFzIG9mIHVzaGVyaW5nIGFuZCBldmVudCBob3N0ZXNzPw==\";s:8:\"question\";s:76:\" Do you have previous experience in t