(19, 'Lasting Impact', 'REG_16807093859425', '<p>It\'s important to see, to recognize, Educating males can open up new skies, Show them the value of females, their potential, And the world will become so much more influential.</p><p>It is a sad reality that gender-based violence has become widespread, Females have to speak out, to avoid being cheated and betrayed, At Girl Child meetings held each month, she\'s taught to find her voice, To assert that she\'s not just a woman, but a powerful being with a choice.</p><p>It\'s crucial to educate males, to make them aware, That they\'re defenders, protectors, with hearts that care, Everyone has a role to play, to make the world better, To create a safer place, for every son and daughter.</p>', NULL, NULL, 'uploads/16807093853159656BOOK_COVER_FRONT.jpg', '16762792563mt5riglkc75e14t6nsvt4o7ca2eeid', '03:43:05', '2023-04-05', 'thumb/16807093859328280BOOK_COVER_FRONT.jpg', 0, NULL, NULL, 'Mr Envoy Oluwayomi', NULL, NULL, NULL, 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2, '2023-04-06', NULL, 100, NULL, '1', 'LastingImpact', NULL, NULL, 1, NULL, 'paid', 'single', '50', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
