(21, 'Launchpad Creative and Entrepreneurial Masterclass', 'REG_16829633885774', '<p>Launchpad is a monthly conference aimed at empowering African entrepreneurs, creatives, and businesses by fostering essential conversations for business success. This conference will bring together top thought leaders from the tech, business, and creative sectors to share valuable insights on a range of topics, including finance and marketing, designed to help our audience unlock their business potential.&nbsp;</p>', NULL, NULL, 'uploads/16829633883490844Blue_Modern_Company_Slogan_LinkedIn_Banner.jpg', '1682962976770m4t8ilr4e8c8ola9iat2ol', '05:49:48', '2023-05-01', 'uploads/16829633883490844Blue_Modern_Company_Slogan_LinkedIn_Banner.jpg', 0, NULL, NULL, 'Mckodev', '<p>Mckodev is a &nbsp;tech company dedicated to helping African entrepreneurs, creatives, and businesses unlock their potential by providing smart and secure solutions for website development.</p>', NULL, 'mckodev', 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-05-26', NULL, 10000, NULL, NULL, 'Launchpad_May23', NULL, NULL, 1, NULL, 'paid', 'single', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Thank you for registering for Launchpad monthly entrepreneiurial masterclass organized by Mckodev.</p>', NULL, NULL, NULL, NULL),
