(24, 'Rhythm of the Jungle: Afrobeat Extravaganza - Stand Order', 'REG_16875279266931', '<p>\"Rhythm of the Jungle: Afrobeat Extravaganza\" is set to ignite the stage in Ekiti. This exhilarating music concert celebrates the effervescent energy of Afrobeat and the alluring sounds of Zinoleesky. The event, crafted specifically for the students of a Federal University, guarantees an unforgettable night of music and entertainment.</p><p>Zinoleesky, an established figure in Afrobeat, will captivate attendees with his unique sound. His presence promises to elevate the concert, infusing it with a contagious spirit that mirrors the vibrancy of Afrobeat.</p><p>The city of Ekiti, renowned for its natural beauty, plays host to this mesmerizing concert. For the university\'s students and the general audience, \"Rhythm of the Jungle: Afrobeat Extravaganza\" promises a memorable night brimming with rhythmic Afrobeat music, amplified by the stirring performances of Zinoleesky.</p>', NULL, NULL, 'uploads/168752792665525416873419273701028WhatsApp_Image_2023_06_21_at_07.50.06_2_.jpeg', 'j90819542aBn72i\n', '01:45:26', '2023-06-23', 'uploads/168752792665525416873419273701028WhatsApp_Image_2023_06_21_at_07.50.06_2_.jpeg', 0, NULL, NULL, 'Rhythm of the Jungle', NULL, NULL, NULL, 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-09-23', NULL, NULL, NULL, '1', 'RJAES', NULL, NULL, 10, NULL, 'paid', 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'NGN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '+2347041649056', '<p>&nbsp;</p>', NULL, NULL, NULL, NULL),
