(4, '2018 Global NGO Technology Report', 'http://techreport.ngo/', 'show', '<p>The 2018 Global NGO Technology Report published by Nonprofit Tech for Goodand sponsored by Public Interest Registry studies how NGOs worldwide use web and email communications, online fundraising tools, social media, mobile technology, and data management and security software. This year, the report is based upon the survey results of 5,352 NGOs from 164 countries</p>', 'admin7115698293', '09:27:28', '2018-03-04', 'reportp82865oy2U9B854'),
(5, 'The Power of Advocacy Report 2018', 'http://www.philanthropy.org.au/images/site/publications/The_Power_of_Advocacy.pdf', 'show', '<p>Published by <a href=\"http://www.philanthropy.org.au/\">Philanthropy Australia</a>, the Power of Advocacy Report argues that philanthropy should also be in the business of funding policy advocacy to help address the root causes of social problems √¢‚Ç¨‚Äú a path to creating lasting systems change. The report also clears up some common misconceptions about the role of philanthropy in politics and policy advocacy for those interested in supporting causes in this area</p>', 'admin7115698293', '03:27:55', '2018-03-08', 'report838744e491h9T'),
