(25, 'Picture Perfect', '15374989361uprete77v5cn86t4067ei', '<p>&nbsp;Picture Perfect. Ladies Event</p><p>Banquet Hall, Jogor Centre 22nd December, 2018</p>', '2018-12-22', '2018-12-22', 'uploads/15374989369339911IMG-20180920-WA0003.jpg', 'e238t723ts7106', '03:02:16', '2018-09-21', 'thumb/15374989366782003IMG-20180920-WA0003.jpg', 0, '12pm', 'No.1, Harvester Drive, Liberty Rd, New Gra, Ibadan', 'Picture Perfect', '<p>&nbsp;</p>', NULL, NULL, NULL, '3.947039600000039', '7.3775355', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'PP', NULL, '231rcfre2', 139, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'Showmie University Show-Off [S.U.S.O]', '1537863510ontm0ws7ihev926868ee2', '<p>S.U.S.O is a fashion weekend for Undergraduates, Post-graduates and recent graduates from tertiary institutions, making host to prominent icons. This is to showcase, award and give prizes to the most creatives, innovative emerging fashion professionals in 8 fashion categories listed on the Showmie platform which are Outfit design, Makeup artist, hair stylist, Models, Jewelry design, Accessory design, Fashion photography, Fashion blogging/columnist.</p>', '2019-11-30', '2019-12-01', 'uploads/15378635105702325Showmie_One-01.jpg', '1537862688oka34a4l9e4l48n689', '00:00:00', '2018-09-25', 'thumb/15378635106083687Showmie_One-01.jpg', 0, '2pm', 'Cucrid, Covenant University', 'Showmie', '<p>Showmie is a fashion hub that provides a unique platform for fashion professionals to showcase their creativity while promoting interaction between them and fashion enthusiast.</p>', NULL, NULL, 'show', '3.16245500354853', '6.677759690328947', 'Nigeria [NG]', 'Ogun', 'Sango Ota', 31026, 2674, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'showmie', 1, '231rcfre2', 896, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(28, 'Olufund fashion house launching', '15383374853n3vee5ul4f056dtu46on2', '<p>Olufund fashion house launching is an event that gives our clients and prospective clients opportunity to benefit a discount rate for purchasing from us or rendering of our services to them that day.</p>', '2018-10-12', '2018-10-19', 'uploads/15383374854444500IMG_20180708_141136_035.jpg', '15383365398u51key020017oldoa1', '00:00:00', '2018-09-30', 'thumb/15383374857689617IMG_20180708_141136_035.jpg', 0, '12:00pm - 4pm', 'Albarka shopping complex bodija ibadan', 'Olukayodefunso', '<p>&nbsp;</p>', NULL, NULL, 'show', '3.947039600000039', '7.3775355', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'OFHL', NULL, '231rcfre2', 762, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(31, 'BROKENBUTGOLD', '1538743672vk79benrbl4god29t280eu3eton3', '<p>I humbly invite you to join a conversation on issues about broken home and how we have being blessed by it. &nbsp;</p>', '2018-10-08', '2018-10-12', 'uploads/15387436728547810IMG_20181003_045251_397.jpg', '1538667359ed4072988io4my8e4', '00:00:00', '2018-10-05', 'thumb/15387436723890768IMG_20181003_045251_397.jpg', 0, '7.30', 'bit.1y/2zCNeAI', 'ODEYEMI FOLASHADE', '<p>I am passionate about individual from broken homes,I am a testimony,lets share and let burden,hurt and unforgiveness go.</p>', 'Odeyemii Folashade', NULL, 'show', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2018-10-12', NULL, 100, NULL, NULL, NULL, NULL, '231rcfre2', 1382, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 'Rendy Meetup  (Event Listing Sample)', '1539548032e54drs2p8e1k9o6b51vca8ten', '<p>This is not a real event. It is a demo that users can use to test out event registration, event listing, and other functions. Feel free to click and surf around on this event.</p>', '2018-12-31', '2019-12-31', 'uploads/15395480323686732IMG_20181009_213530_391.jpg', 'e238t723ts7106', '00:00:00', '2018-10-14', 'thumb/15395480323057652IMG_20181009_213530_391.jpg', 0, '12:00am', 'Baale Close, Oregun Lagos', 'Boardspeck', '<p>An Online Article, event and Training Promotion tool. On Boardspeck, you can post your articles, events and training and manage your content easily for publicity.</p>', 'boardspeck', 'boardspeck', 'show', '5.2236252770508145', '7.617038767121636', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, 1, '2019-12-31', NULL, 132, NULL, '1', 'demoevent', 1, '231rcfre2', 1606, NULL, 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 'Entrepreneurs Hangout November 2018 Edition', '1539974445uesv57n3t31neet7reepe4r8nr79', '<p>&nbsp;</p><p>Theme: Positioning your Business</p><p>Date: Thursday, Ist November 2018.&nbsp;</p><p>Venue: De-Link Hotel, Iworoko Road, Ado Ekiti.</p><p>&nbsp;</p><p><strong>Highlights:&nbsp;</strong></p><p>Getting your noticed in the market&nbsp;</p><p>The challenge of funding</p><p>Business Exhibition&nbsp;</p><p>Business Networking.</p><p><strong>Convener: Tope Popoola</strong></p>', '2018-11-01', '2018-11-01', 'uploads/15399744451112361IMG-20181019-WA0006.jpg', 'e238t723ts7106', '00:00:00', '2018-10-19', 'thumb/15399744452152514IMG-20181019-WA0006.jpg', 0, '11:00am', 'De-Link Hotel, Iworoko Road, Ado EKITI', 'The Lead Initiative', '<p>Business Success is not by happenstance. In a world where CHANGE and INNOVATION are the only CONSTANTS in Enterprise, \"only the paranoid survive\" (in the words of Andy Grove, Former CEO of Intel).</p><p>If you live in Ekiti, join other entrepreneurs at the Entrepreneurs\' Hangout.</p><p>&nbsp;</p><p>&nbsp;</p>', 'lifempower', 'topheritage', 'show', '5.237108700000022', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, NULL, 'https://docs.google.com/forms/d/e/1FAIpQLSeVM7egNNZUHRkfkCIfN7Lgq3iHnVL6dtgvqGX6uysXE4NeFA/viewform?usp=pp_url', NULL, NULL, NULL, 'EHONOV18', NULL, '231rcfre2', 839, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 'SIFT-THINK CONFERENCE 2018 (EKSU)', '15400463045k54hne8fst6ivt86ie5t7n5', '<p>Sift-think Conference is an annual conference held in Nigerian campuses to sensitize Undergraduates, Graduates and Corps members on the need to be creative and proactive, maximize the opportunities around them as they think outside the box.</p><p>Sift-think conference will take place on the 2nd of November at the University lecture theatre in Oduduwa auditorium EKSU . The theme would be \"Thinking out of the box?\", and our Vision is to raise 100 businesses in Nigeria before 2050 and therefore empowering the minds of Nigerian youths from mediocrity to creativity.</p>', '2018-11-03', '2018-11-03', 'uploads/15400463045644112IMG-20181020-WA0025.jpg', 'e238t723ts71062', '00:00:00', '2018-10-20', 'thumb/15400463042026888IMG-20181020-WA0025.jpg', 0, '10:00am', 'O\'dua Hall Ekiti State University, Ado- Ekiti.', 'DLight Initiative', '<p>&nbsp;</p>', NULL, NULL, 'hide', '5.252118957193375', '7.713798576382494', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2018-11-03', NULL, 674, NULL, '1', 'siftthink2018', 1, '231rcfre2', 310, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
