(36, 'THE CONVERGENCE (Ekiti Youth Summit)', '154090843986h74te8tne564e06v', '<p>Gathering of Ekiti State Youths</p>', '2018-11-02', '2018-11-02', 'uploads/15409084391591858IMG-20181030-WA0009.jpg', 'e238t723ts7106', '00:00:00', '2018-10-30', 'thumb/15409084398405581IMG-20181030-WA0009.jpg', 0, '11:00am', 'Amazing Grace Event Hall,Opposite BSCS, Ilokun. Ado Ekiti  ', 'Glimpse NG & Voice FM', '<p>Glimps NG is an IT Firm that deals with all ICT Involvements.</p>', NULL, NULL, 'show', '5.237108700000022', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'convergence2018', NULL, '231rcfre2', 901, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(38, 'The e17 Summit ', '15431239661e610tnhve504te5', '<p>&nbsp;</p><p>The e17 Summit is a domesticated United Nations Environment programme (UNEP) Summit slated for 29th of November, 2018 and it\'s organized by all of us at ECOMSA<br>The summit conceptualizes environmental management and the 17 Sustainable Development Goals. I simply put as, how can we use environmental management to achieve the 17 SDGs. This development however requires the gathering of stakeholders (Environmentalist, SDGs promulgators and champions, organizations, institutions and social groups) to meet and design Nature based action plans that are practicable locally in order to facilitate the actualization of the 17 SDGs before 2030.</p><p>THE e17 SUMMIT√Ç¬© slated for √¢≈í≈° November 29, 2018 √¢≈í≈° will hold in the premises of the premises of the √∞≈∏¬è‚Ä∫Institute of Ecology and Environmental Studies, Obafemi Awolowo University, Ile-Ife, Nigeria.</p><p>The summit is free √¢¬ù≈í√∞≈∏‚Äô¬∞√¢¬ù≈í and open√∞≈∏‚Äú‚Äì to attendance by all individuals, institutions, associations, clubs, campuses, organisations, environmental stakeholders, enthusiasts, SDGs champions and promulgators worldwide.√∞≈∏≈í≈Ω√∞≈∏≈í¬ç√∞≈∏≈í¬è.</p><p>&nbsp;</p>', '2018-11-29', '2018-11-29', 'uploads/15431239666799914IMG-20181125-WA0001.jpg', 'e238t723ts7106', '00:00:00', '2018-11-25', 'thumb/15431239665330228IMG-20181125-WA0001.jpg', 0, '10AM', 'Institute of Ecology and Environmental Studies, Obafemi Awolowo University, Ile-Ife, Nigeria.', 'ECOMSA', '<p>ECOMSA</p>', NULL, NULL, 'show', '4.552127400000018', '7.490462', 'Nigeria [NG]', 'Osun', 'Ife', 31042, 2676, 160, 1, NULL, 'https://bit.ly/e17attendance', NULL, NULL, NULL, 'TheE17Summit', NULL, '231rcfre2', 902, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(39, 'Entrepreneurs Hangout December 2018 Edition', '1543125295ve4r4trs8eptue38e26er0en8nn8', '<p>What are you passionate about?</p><p>Yes! Everybody has one &nbsp;passion or the other, but not everyone knows his or her passion.</p><p>Most people who know their passion find it difficult to turn their passion into profit.</p><p>Some have different passions but are confused on knowing which passion is profitable.</p><p>Hence, they live frustrated, unfulfilled and unhappy life.</p><p>In this month\'s Entrepreneurs Hangout, our Guest Speaker : Jumoke Olowokere, would be sharing the EXACT SAME strategies through which you can TURN YOUR PASSION INTO PROFIT.</p><p>Don\'t miss this rare opportunity.</p><p>Spaces are LIMITED and so you need to register NOW<br>http://bit.ly/EntrepreneursHangoutDecember18</p><p>Highlights of the events include:</p><p>√¢≈ì‚Äù Turning waste to Wealth.&nbsp;<br>√¢≈ì‚ÄùUnderstanding the power of passion.&nbsp;<br>√¢≈ì‚Äù The Business in advocacy.<br>√¢≈ì‚Äù Networking and more.</p><p>The event is Thursday, 6th of December, 2018.</p><p>Time is 11AM prompt.</p><p>Don\'t hesitate to register now.</p><p>Registration is FREE.</p><p>Click the link below to register now √∞≈∏‚Äò‚Ä°<br>http://bit.ly/EntrepreneursHangoutDecember18</p><p>For More Details Call:&nbsp;<br>Daniel: 08068610522<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 08123804028</p><p>Host,&nbsp;<br>Temitope Popoola</p>', '2018-12-06', '2018-12-06', 'uploads/15431252954837822EHO_Think_Tanks._20181125_064651.jpg', 'e238t723ts7106', '00:00:00', '2018-11-25', 'thumb/15431252953019582EHO_Think_Tanks._20181125_064651.jpg', 0, '11:00am', 'De-Link Hotel, Iworoko Road, Ado EKITI', 'The Lead Initiative', '<p>The Lead Initiative</p>', NULL, NULL, 'show', '5.2352337574819785', '7.661234658997713', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, NULL, 'http://bit.ly/EntrepreneursHangoutDecember18', NULL, NULL, NULL, 'EHODec18', 1, '231rcfre2', 820, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NUL