(40, 'The Board Room (December Edition)', '1543529396246e2ett9n4h5e98v3', '<p>Thinking School Presents December Edition of #TheBoardRoom</p><p>&nbsp;</p><p><br>It promises to be exciting as real and practical samples will be shared on growing business using collaboration and Synergy building as hacks.</p><p><br>Follow<br><a href=\"https://api.whatsapp.com/send?phone=2348168844683&amp;text=I%20Want%20To%20Reserve%20A%20Seat\">https://api.whatsapp.com/send?phone=2348168844683&amp;text=I%20Want%20To%20Reserve%20A%20Seat</a> to<br>register.</p><p><br>See image for details</p>', '2018-12-15', '2018-12-15', 'uploads/15435293955619282IMG-20181129-WA0008.jpg', 'e238t723ts7106', '00:00:00', '2018-11-29', 'thumb/15435293968430835IMG-20181129-WA0008.jpg', 0, '10am', 'Ado Ekiti', 'Thinking School', '<p>Thinking School</p>', NULL, NULL, 'show', '5.208826534623654', '7.642133857952139', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'theboardroom', 1, '231rcfre2', 848, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(41, 'The ArtMesh', '1560278419e2v177n97h19eet03t', '<p>In the <a href=\"http://facebook.com/arthutnig\">ArtHut</a>\'s bit to improve arts in Africa (commencing with literary arts), we are organizing our first ArtMesh which would be a live poetry-reading session at the American Corner (294 Herbert Macaulay Road Yaba, Lagos, Nigeria)</p><p>You a poet or interested in literary arts?<br>Come and let\'s make an attempt to grow arts.</p><p>All performances will be recorded and uploaded to our YouTube channel <a href=\"https://www.youtube.com/channel/UCmjmSVmZ6bP3hxPIxq45kEw\">https://www.youtube.com/channel/UCmjmSVmZ6bP3hxPIxq45kEw</a> where we intend to promote them.<br><br>Join our Facebook community via <a href=\"https://facebook.com/arthutgroup\">https://facebook.com/arthutgroup</a> if you haven\'t.</p><p><i>Note: There is a limit to spaces available</i></p>', '2019-06-28', '2019-06-28', 'uploads/15602784197007756ArtMesh_banner.jpeg', '36au8m1elEn53m8538', '00:00:00', '2019-06-11', 'thumb/15602784193761803ArtMesh_banner.jpeg', 0, '2:00 PM - 5:00 PM', '294 Herbert Macaulay Way, Yaba , Lagos', 'ArtHut', '<p>An arts organizations aimed at growing arts from the roots.</p>', 'arthutniig', 'arthutng', 'show', '3.375866158935537', '6.5132166464709655', 'Nigeria [NG]', 'Lagos', 'Surulere', 30987, 2671, 160, 1, NULL, 'https://www.eventbrite.com/e/the-artmesh-tickets-63245383645', NULL, NULL, NULL, 'artmesh1', 1, '231rcfre2', 936, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(49, 'EKITI TWITTER CONFERENCE (ETC 2019)', 'EVT_1575912075ne41i6ke24tit71ev966', '<p>The One Ekiti team will host the maiden annual Twitter Conference titled&nbsp;<strong>\"</strong><i><strong>Beyond the Talk: Understanding the Essence of Synergy for Solutions as a Twitter Community</strong></i><strong>,\" </strong>will hold&nbsp;at the Adunni Olayinka Hall, Ado- Ekiti on&nbsp;<strong>Tuesday 17th of December, 2019</strong>.</p><p>This year√¢‚Ç¨‚Ñ¢s Twitter conference seeks to propel young people in the Twitter community to harness the power of the communication age and partnerships for societal development rather than self-aggrandizement and cheap popularity. Through collaboration, youths leading initiatives in different sectors can build capacity to share resources and make a measurable developmental impact in Ekiti State.</p><p>Attendance at the venue is strictly by invitation. There are <strong>100</strong> spaces available for this conference. The event is targeting active young Ekiti Twitter users who are major drivers of initiatives in the academia, ICT, business community, advocacy, and health sector to address the deficit in synergy and partnership as a Twitter community.</p><p><br><strong>Time:&nbsp;11am</strong></p><p><strong>To register: </strong>&nbsp;If you wish to attend, please send a mail to <a href=\"mailto:oneekitiofficial@gmail.com\">oneekitiofficial@gmail.com</a> indicating your <strong>name</strong>, your <strong>Twitter handle</strong>, your <strong>contact email address and phone number</strong>, the <strong>organization </strong>or <strong>institution</strong> you are working, in what capacity and what is your sector of affiliation (e.g. Health, ICT ..). <strong>Upon acceptance, </strong>you will receive an email with a <strong>QR Code </strong>confirming your participation.</p><p><i>Please note that the only valid identification is the <strong>QR Code </strong>and without which you will not be able to access the venue.</i></p><p>However, <strong>if you do not receive an official invitation</strong> from the organizer, you can still participate in the conference. Anyone can participate √¢‚Ç¨‚Äú You do not have to be at the venue. To participate in&nbsp;<strong>#EkitiTwitterConference2019</strong>, just log on to Twitter on the day of the conference (December 17, 2019) <strong>by 12pm</strong> and search for the conference hashtag&nbsp;<strong>#EkitiTwitterConference2019</strong>&nbsp;to follow all of the sessions. The conference will also be <strong>Live Stream</strong> on Twitter.</p><p>For further information: <strong>ONE EKITI</strong>: &lt;<a href=\"https://oneekiti.com.ng/blog/one-ekiti-announces-the-maiden-edition-of-the-ekiti-twitter-conference-etc-2019/\">https://oneekiti.com.ng/blog/one-ekiti-announces-the-maiden-edition-of-the-ekiti-twitter-conference-etc-2019/</a>&gt;</p>', '2019-12-17', '2019-12-17', 'uploads/15761589361906218c0dc193e_bdda_4f52_a446_3e64a4482d16.JPG', 'j90819542aBn72i', '01:55:36', '2019-12-12', 'thumb/15761589369199560c0dc193e_bdda_4f52_a446_3e64a4482d16.JPG', 0, '11AM', 'Adunni Olayinka Hall, Ado- Ekiti', 'One Ekiti', '<p>One Ekiti is building a united and resilient community on Twitter for solutions in Ekiti State.</p><p>Visit www.oneekiti.com.ng for more information.</p>', 'One-Ekiti-1553489234785266', 'oneekiti', 'show', '5.213634006701682', '7.629313205441036', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 2, '2019-12-18', NULL, 139, NULL, '1', 'ETC2019', 1, '231rcfre2', 1427, NULL, 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(50, 'EKITI TWITTER PARTY AND AWARDS', '1575909605e9i81t68kt5ne48i0ev', '<p>The One Ekiti team will host the second edition of the Ekiti Twitter Party and Awards on Saturday, <strong>21st December, 2019</strong> at Fajuyi Park, Ado Ekiti, Ekiti State.</p><p><strong>Time:&nbsp;12pm</strong></p><p>This is an <strong>open event</strong> for young people who are actively using Twitter to drive social impact and change across sectors in Ekiti State.</p><p>The hangout session provides an invaluable opportunity for members of the digital community to meet, connect and interact in a comfy and unorthodox setting.</p><p>The award session celebrates the extraordinary achievements of young people in Ekiti State and the incredible journeys they took to get there. The awards also serve to inspire other young people to take action in communities across the State.</p><p>Kindly reach out to <a href=\"mailto:oneekitiofficial@gmail.com\">oneekitiofficial@gmail.com</a> or <strong>Debiwumi</strong> (09037228640) &amp; <strong>Francis</strong> (07039004141) for tickets. You will need to purchase a Shirt and Cap from the organizers and upon confirmation, you will get a <strong>QR Code.</strong></p><p>Please note that you must go through security. <strong>Without the customized shirt and QR Code, you will not be able to gain access to the venue.</strong></p><p>This event is part of the activities outlined for the Twitter week this December in Ekiti State. Please go to &lt;<a href=\"https://oneekiti.com.ng/blog/one-ekiti-announces-the-maiden-edition-of-the-ekiti-twitter-conference-etc-2019/\">https://oneekiti.com.ng/blog/one-ekiti-announces-the-maiden-edition-of-the-ekiti-twitter-conference-etc-2019/</a>&gt; for more information.</p>', '2019-12-21', '2019-12-21', 'uploads/157615963075577806055927a_0690_46c7_aa95_6ec8d0c0d3ef.JPG', '1576161374_5710325', '02:07:10', '2019-12-12', 'thumb/157615963073796786055927a_0690_46c7_aa95_6ec8d0c0d3ef.JPG', 0, '12pm', 'Fajuyi Park, Ado Ekiti, Ekiti State.', 'One Ekiti', '<p>One Ekiti is building a united and resilient community on Twitter for solutions in Ekiti State.</p><p>Visit www.oneekiti.com.ng for more information.</p>', 'One-Ekiti-1553489234785266', 'oneekiti', 'show', '5.214148990832541', '7.631312366765376', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 2, '2019-12-22', NULL, 4930, NULL, '1', 'ekititwitterparty', 1, '231rcf34re2', 1642, NULL, 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
