(68, 'INNOVATE - VENDORS CONFERENCE ', 'EVT_15991378157432', '<p>It\'s time for us as Vendors and Entrepreneurs to become more innovative especially in this period of the Covid19 pandemic. This conference is put together to help open the minds of Entrepreneurs to new business ideas and possibilities around them and the world at large. To help them sharpen their skills to a better professional level and learn strategies of growing a successful business brand even in the midst of Covid19 pandemic.</p><p>This Conference is powered By Ekiti Event Vendors<br>Kindly like our Facebook page through <a href=\"https://www.facebook.com/ekitieventvendors/\">https://www.facebook.com/ekitieventvendors/</a><br>And follow us on Instagram through <a href=\"https://instagram.com/ekitieventvendors?igshid=1b4ngwc57xcxr\">https://instagram.com/ekitieventvendors?igshid=1b4ngwc57xcxr</a></p>', '2020-09-27', '2020-09-27', 'uploads/15991378157264499IMG_20200903_WA0023.jpg', '1599134722lmak1ky5i480i4coelu54iir3aawbu5ntu', '12:56:55', '2020-09-03', 'thumb/15991378155462878IMG_20200903_WA0023.jpg', 0, '7pm', NULL, 'Janet Alalade ', '<p>Janet Alalade is dynamic business woman and Entrepreneur with sincere desire to help Entrepreneurs, both young and old to get it right and rise to the top.<br>She\'s a passionate baker and Event Service Provider.<br>With a great personality, she loves to help people and also volunteer in various aspects that has to do with human development in skills and mind.<br>She is the Founder of DaisyJaneCakes \'N\' More, a baking and event service company that provides excellent service with great taste.<br>She also runs Adukes Empire, an importation business that provides daily, Fashion and Home essentials to people.</p><p>For more enquiries, sponsorship and volunteering<br>Kindly call or message her on Whatsapp on 0703 204 9636</p><p>This Conference is powered By Ekiti Event Vendors<br>Kindly like our Facebook page through <a href=\"https://www.facebook.com/ekitieventvendors/\">https://www.facebook.com/ekitieventvendors/</a><br>And follow us on Instagram through <a href=\"https://instagram.com/ekitieventvendors?igshid=1b4ngwc57xcxr\">https://instagram.com/ekitieventvendors?igshid=1b4ngwc57xcxr</a></p>', NULL, NULL, 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2020-09-27', NULL, 1747, NULL, NULL, 'Innovate', NULL, '231rcfre2', 2249, 'Innovate, vendors conference ', 'free', NULL, NULL, NULL, 'Facebook', 'a:5:{s:12:\"QWRkcmVzcyA=\";a:5:{s:2:\"id\";s:12:\"QWRkcmVzcyA=\";s:8:\"question\";s:8:\"Address \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:4:\"QWdl\";a:5:{s:2:\"id\";s:4:\"QWdl\";s:8:\"question\";s:3:\"Age\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:3:{i:0;s:5:\"13-20\";i:1;s:5:\"21-40\";i:2;s:13:\"40 and above \";}s:8:\"required\";b:1;}s:16:\"T2NjdXBhdGlvbiA=\";a:5:{s:2:\"id\";s:16:\"T2NjdXBhdGlvbiA=\";s:8:\"question\";s:11:\"Occupation \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:84:\"RG8geW91IHdhbnQgdG8gYmUgYWRkZWQgdG8gYmUgYWRkZWQgdG8gb3VyIFdoYXRzYXBwIGNvbW11bml0eSA=\";a:5:{s:2:\"id\";s:84:\"RG8geW91IHdhbnQgdG8gYmUgYWRkZWQgdG8gYmUgYWRkZWQgdG8gb3VyIFdoYXRzYXBwIGNvbW11bml0eSA=\";s:8:\"question\";s:62:\"Do you want to be added to be added to our Whatsapp community \";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:3:\"Yes\";i:1;s:2:\"No\";}s:8:\"required\";b:1;}s:68:\"QXJlIHlvdSBmb2xsb3dpbmcgdXMgb24gb3VyIHNvY2lhbCBtZWRpYSBwbGF0Zm9ybXM=\";a:5:{s:2:\"id\";s:68:\"QXJlIHlvdSBmb2xsb3dpbmcgdXMgb24gb3VyIHNvY2lhbCBtZWRpYSBwbGF0Zm9ybXM=\";s:8:\"question\";s:50:\"Are you following us on our social media platforms\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:3:\"Yes\";i:1;s:2:\"No\";}s:8:\"required\";b:1;}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
