(87, 'Ekiti Garri Hangout 2020', 'EVT_16079683038809', '<p>This event will be educative, entertaining and productive. It entails agricultural and entrepreneurial lectures from reputable facilitators. Upcoming brands will be given opportunity to showcase their brands and the services they can offer. This event will encourage young talented individuals wishing to gain recognition in the entertainment industry.</p><p>Ticket prices are:</p><p>Regular- #1000, VIP- #2500, VVIP- #5000</p>', '2020-12-26', '2020-12-26', 'uploads/1608100970mail5824948e34ae4cd78c1ae97d45bd0c59.jpg', '1607964926d68a4ke21rl7a6ii76ctr', '05:51:43', '2020-12-14', 'thumbs/1608100970mail5824948e34ae4cd78c1ae97d45bd0c59.jpg', 0, '3:00pm', 'Fajuyi Park, Ado Ekiti', 'Samluv Foods Enterprise', NULL, NULL, NULL, 'show', '5.237108699999999', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2020-12-26', NULL, NULL, NULL, '1', 'Ekitigarrihangout2020', NULL, '231rcf34re2', 1389, NULL, 'paid', 'categorized', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
