(89, 'Tatamina Book Launch', 'EVT_16087831123289', '<p>The public is invited to the virtual launch of Tatamina, a eye-opening short story that exposes the lifestyle of the Yalunka tribe (a really small clan) in Sierra Leone.</p><p>Launch date: Dec 27, 2020</p><p>Time: 8:30 PM (Nig) | 7:30 PM (S.L)</p><p>Zoom Meeting details:</p><p><a href=\"https://us04web.zoom.us/j/74402418534?pwd=VVBxY0lyS0dXTFN5dWtDMGZpQ1VuQT09&amp;fbclid=IwAR2TgOqjoZ_pkF31sOztM41X37CQN51rGtb_gHZBNKa0WI_hyJUnegD2Gwc\">https://us04web.zoom.us/j/74402418534...</a></p><p>Meeting ID: 744 0241 8534</p><p>Passcode: 4gNxZT</p><p>You may join the WhatsApp discussion group to be prompted ... <a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Flnk.ng%2Ftatamina%3Ffbclid%3DIwAR2wDUWaDuiIN_DkVxT96lb2EQAIGr4hkT-yCSLm16koa2B0OKsNAXb_UmE&amp;h=AT0Q6wKnGNT4wvsm12pOHY9fHH2SHnMUk8YfGSpls1Vryyaim8ZE1jUfcI60e99ynF2v-DYfd7Dkcv1shZxztWThZCT0KJW9-UEBlLhxZmWrc5_W2W33r_LGdF4dbNSngL8&amp;__tn__=-UK-R&amp;c[0]=AT2Oo6yzYeRLlbp49M9Cg-7D1PR-SqHdETkH14a7kIo6F45WGXDCRwqxDLe4ubMlCuueVfoWY8J_ckc5Dxlbcdvs7e_4ctqtO4x_c-jRbCMgyC84zOIwyk5gj_tqDlFQ9CLHWRXLWbEdI0Y4-umjit-dY8r2f4q6O5E99B4M8T9Z6C2oKfjIA8BXaCNqnd_xH-8CnpugTKLGYD3jFpJgrYHpVequdcVYtZcAc86iKPvdXG-2bdU\">https://lnk.ng/tatamina</a></p><p><a href=\"https://web.facebook.com/hashtag/arthut?__eep__=6&amp;__cft__[0]=AZXdiOLtP7yc0BJ4I51myzvsqbzjblIf-RDsT_5h8u0HyFzaOJeK_dwlcQ0nUbczJlnHG2y9mA8VVA1zM1nyRMAKIhpgTnWqaZVcNKLQVTPmOynDULwEYHIEqgrU4DOKp0sTO-inDrG95mM8-CozEgW6r1lrayoxyXOo7EWsvD4w2A5g5kLH2YbXhHlaELiugq3PLh8DBgKJi1rpu4wXno-J9wO6b_ayMLoAQ16PO2Sltw&amp;__tn__=*NK-R\">#ArtHut</a> <a href=\"https://web.facebook.com/hashtag/anarthutpublication?__eep__=6&amp;__cft__[0]=AZXdiOLtP7yc0BJ4I51myzvsqbzjblIf-RDsT_5h8u0HyFzaOJeK_dwlcQ0nUbczJlnHG2y9mA8VVA1zM1nyRMAKIhpgTnWqaZVcNKLQVTPmOynDULwEYHIEqgrU4DOKp0sTO-inDrG95mM8-CozEgW6r1lrayoxyXOo7EWsvD4w2A5g5kLH2YbXhHlaELiugq3PLh8DBgKJi1rpu4wXno-J9wO6b_ayMLoAQ16PO2Sltw&amp;__tn__=*NK-R\">#AnArtHutPublication</a>.</p>', '2020-02-27', '2020-12-27'