(96, ' African IMPACT LEADERSHIP AWARD', 'EVT_16149470002830', '<p>African Impact Leadership Award of the year is being conceptualized to be a widely recognized accolade a person can receive in Africa. It was designed to afford the people of the continent with the occasion to pay tribute to individuals who have made a real and valuable contribution to our society. The Awards are considered not just to give public recognition to those who in their way, have made such a positive impact on Africa, but whose public and private comportments typify the ethos of OMOLUABI (An African value) Therefore, the Award recognizes a unique range of indigenes of African Ancestry √¢‚Ç¨‚Äú from unsung heroes who have quietly made a difference and enhanced the lives of others in communities, so the household names who have made a real difference to people√¢‚Ç¨‚Ñ¢s lives on a national and international level. This year√¢‚Ç¨‚Ñ¢s event will provide a platform to celebrate the continent√¢‚Ç¨‚Ñ¢s pillars of hope √¢‚Ç¨‚Äú business, political and diplomatic leaders who are helping us to see the light pf possibilities in the midst of a global pandemic that has become an existential threat.</p>', '2021-03-08', '2021-06-05', 'uploads/1618435326mail1747297IMG_20210331_WA0045_1_.jpg', '1614792954cm59acti29ra6l2i33pe16t', '12:23:20', '2021-03-05', 'thumbs/1618435326mail1747297IMG_20210331_WA0045_1_.jpg', 0, '12:00 - 5:00', 'Ghana', 'African Impact Magazine ', '<p>African IMPACT Magazine is one of the Africa√¢‚Ç¨‚Ñ¢s new generation empowered public relations outfit with a mission: Mission: To build Africa√¢‚Ç¨‚Ñ¢s foremost Public Relations and Event Management Organisation with a network of world√¢‚Ç¨‚Ñ¢s best policy advocacy team propelling the frontiers of Africa√¢‚Ç¨‚Ñ¢s advancement. We offer full-service public relations and communications strategy programmes to clients from our office in Accra-Ghana and Abuja-Nigeria. We can reach into the African continent through our sound-footing network and affiliation to IPRC strategies which is part of the API group which cut across the African continent.<br>We offer a mix of communications experience and expertise spanning the business, corporate and public sector and civil society<br>Our products/services<br>√Ç¬∑ Public Relations, Publishers of African IMPACT Magazine, the IMPACT specials etc, Event Management, Reputation Management, Stakeholder management, Conferences and Awards<br>PLS KINDLY FORWARD ANY ENQUIRIES WHERE NECESSARY.<br>Other relevant messages should be sent to our correspondence office or via our email :africanimpactleadershipawards@gmail.com.</p>', 'AfricanImpactMagazine', '@AfricaImpactMa1', 'hide', '-0.08869479999999999', '5.977963099999999', 'Ghana [GH]', 'Northern', 'Tamale', 20414, 1406, 83, 1, '2021-06-30', NULL, 2000, NULL, '1', 'AILA', NULL, '231rcf34re2', 187, NULL, 'free', NULL, NULL, '1', NULL, 'a:1:{s:12:\"TG9jYXRpb24g\";a:5:{s:2:\"id\";s:12:\"TG9jYXRpb24g\";s:8:\"question\";s:9:\"Location \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(97, 'Hike Ekiti Mountain Safari 3.0', 'EVT_16151972163425', '<figure class=\"media\"><oembed url=\"https://youtu.be/CSsqvQ3mby8\"></oembed></figure><p><strong>ABOUT HIKE EKITI MOUNTAIN SAFARI 3.0</strong></p><figure class=\"media\"><oembed url=\"https://youtu.be/CSsqvQ3mby8\"></oembed></figure><p><strong>Hike Ekiti Mountain Safari </strong>organized by <strong>Discover Ekiti </strong>is a destination branding and community place marketing&nbsp; outdoor mountain tourism adventure event that is&nbsp; envisioned to project, promote and market&nbsp; Ekiti To The World as one of the best choice destination for mountain tourism adventures.&nbsp;</p><p>The first edition of Hike Ekiti Mountain Safari held In April 2019 was a huge success, leveraging on the power of traditional and&nbsp; digital media, our compelling brand promotion strategies, integrated marketing communication channels and support for donors and sponsors, the event&nbsp; attracted the patronage of Mountain Hikers and Tourist Adventurers within and outside the country.&nbsp;</p><p>It is also worthy to note that the maiden edition of the event attracted International Hikers, Tourists and Enthusiast from the following countries; South Africa, Dubai, Jamaica and Germany. We also had bookings from tourists in New York and London. Local Tourists in attendance were from Lagos, Abuja, Port Harcourt, Oyo, Kwara, Ondo, Ogun, Osun, Kogi, and Delta State respectively.</p><p><strong>LOCATION FOR HIKE EKITI MOUNTAIN SAFARI 3.0</strong></p><figure class=\"media\"><oembed url=\"https://youtu.be/CSsqvQ3mby8\"></oembed></figure><p>This year edition of Hike Ekiti Mountain Safari 3.0 which will be holding on Easter Monday April 5, 2021. The destination for <strong>Hike Ekiti Mountain Safari 3.0&nbsp; </strong>is the astonishing <strong>Abanijorin Cave and Mountain</strong> along Old Ado Road, Tungba, Iyin Ekiti (a newly discovered Tourist Attraction that has the following natural attractive features:</p><p>1. a combination of more than 7 caves,</p><p>2.a naturally formed amphitheater in form of a cave ,</p><p>3.a rock tunnel and amazing rock formations that is ideal for mountain tourism tours, exploration&nbsp; and adventures.</p><p><strong>IMPACT DELIVERABLES OF HIKE EKITI MOUNTAIN SAFARI 3.0</strong></p><p>Through the HIKE EKITI MOUNTAIN SAFARI event, &nbsp;we intend to achieve the following Social Impact Objectives and deliverables:</p><p>1. Project and Promote Ekiti to the world as a choice destination for Mountain Tourism Adventures.</p><p>2. Attract Global, National and Local Tourists &nbsp;that will visit Ekiti and have an exciting, thrilling and magical experience hiking, touring and exploring Ekiti Hills and Mountains.</p><p>3. &nbsp;Attract Investors and Developmental partners who will show interest in investing in Ekiti Mountain Tourism Potentials.</p><p>4. Advocate for the Government√¢‚Ç¨‚Ñ¢s political will towards providing Infrastructures that will help upgrade these tourists√¢‚Ç¨‚Ñ¢ attractions to destination sites with facilities that will help attracts repeated patronage of tourists and adventurers.</p><p>5. Advocate for Community Based Tourism Development through the following strategies:</p><p>- &nbsp;Ensure that Government create Tourism Policies and &nbsp;Infrastructures that will enable residents of local communities benefits and earn income from the services and value chain of the local Tourism Economy</p><p>- Educate &amp; Sensitize communities about the economic importance of Tourist attractions in their locality and the need for conservation and protection of the tourists attractions</p><p>- Collaborate with local communities with astonishing tourist attractions on how to foster and attract &nbsp;infrastructures that will help in sustainable development, conservation of the the tourist attractions</p><p>TICKET CATEGORIES FOR HIKE EKITI &nbsp;MOUNTAIN SAFARI 3.0</p><p>&nbsp;</p><p>STUDENTS<br>- Tickets<br>- Glucose<br>- Water<br>- Light Refreshments</p><p>N2000</p><p>REGULAR&nbsp;<br>√¢‚Ç¨¬¢ Tickets&nbsp;<br>√¢‚Ç¨¬¢ Glucose&nbsp;<br>√¢‚Ç¨¬¢ Energy Drink&nbsp;<br>√¢‚Ç¨¬¢ Water&nbsp;<br>√¢‚Ç¨¬¢ Games&nbsp;<br>√¢‚Ç¨¬¢ Refreshments&nbsp;<br>N3,000</p><p>&nbsp;</p><p>PREMIUM &nbsp;&nbsp;<br>√¢‚Ç¨¬¢ Tickets&nbsp;<br>√¢‚Ç¨¬¢ Glucose&nbsp;<br>√¢‚Ç¨¬¢ Energy Drink&nbsp;<br>√¢‚Ç¨¬¢ Water&nbsp;<br>√¢‚Ç¨¬¢ Games&nbsp;<br>√¢‚Ç¨¬¢ Refreshments&nbsp;<br>√¢‚Ç¨¬¢ Branded Event Face cap&nbsp;<br>√¢‚Ç¨¬¢ Branded Drawstring Bag</p><p>N5,000</p><p>&nbsp;</p><p>GOLD</p><p>√¢‚Ç¨¬¢Tickets&nbsp;<br>√¢‚Ç¨¬¢ Glucose&nbsp;<br>√¢‚Ç¨¬¢ Energy Drink&nbsp;<br>√¢‚Ç¨¬¢ Water&nbsp;<br>√¢‚Ç¨¬¢ Games&nbsp;<br>√¢‚Ç¨¬¢ Refreshments&nbsp;<br>√¢‚Ç¨¬¢ Branded Event Face cap&nbsp;<br>√¢‚Ç¨¬¢ Branded Drawstring Bag&nbsp;<br>√¢‚Ç¨¬¢ Branded Event T-Shirts&nbsp;<br>√¢‚Ç¨¬¢ Branded Event Water &nbsp;<br>Bottle</p><p>N8,000</p><p>For further Enquiry, collaboration &amp; Partnership contact: 08145502813, 07061924727, 08168900183, 07033942819</p><p>To know more about our social impact activities so far, kindly download a copy of our social impact report via http://bit.ly/HikeEkitiMountainSafariSocialImpactReport</p>', '2021-04-05', '2021-04-05', 'uploads/1615872477mail0001_18360729039_20210316_062335_0000.png', '1584298276_3896622', '09:53:36', '2021-03-08', 'thumbs/1615872477mail0001_18360729039_20210316_062335_0000.png', 0, '7am - 1pm', 'Abanijorin Mountain & Cave Safari, Off Police Headquarters, Ado Road, Tungba, Iyin Ekiti (Before Odoro Settlement)', 'Discover Ekiti', '<p>Discover Ekiti is a Destination Marketing organization that is committed towards projecting, Promoting and Showcasing Ekiti Tourism Potentials to the world</p>', NULL, NULL, 'show', '5.20099', '7.66699', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2021-04-15', NULL, NULL, NULL, '1', 'HikeEkiti3.0', 1, '231r23100234', 5670, 'Hike,Mountain, Tour, Hike 3.0,Mountain Safari, Safari,Dicover Ekiti', 'paid', 'categorized', NULL, NULL, NULL, 'a:1:{s:32:\"Q3VycmVudCBTdGF0ZS9Mb2NhdGlvbg==\";a:5:{s:2: